package main

import (
	"fmt"
	"strconv"
	"strings"
	"testing"

	"github.com/stretchr/testify/assert"
)

type Node struct {
	Children []Node
	Metadata []int
}

func processNodes(nodeList []Node, numberArray []int, currentOffset int) ([]Node, int) {
	// We assuem that we are dropped in at the start of a new node
	nodeChildrenHeader := numberArray[currentOffset]
	currentOffset++
	nodeMetadataHeader := numberArray[currentOffset]
	currentOffset++

	thisNode := Node{}
	thisNode.Children = make([]Node, 0)
	for i := 0; i < nodeChildrenHeader; i++ {
		thisNode.Children, currentOffset = processNodes(thisNode.Children, numberArray, currentOffset)
	}

	for i := currentOffset; i < currentOffset+nodeMetadataHeader; i++ {
		thisNode.Metadata = append(thisNode.Metadata, numberArray[i])
	}

	newList := append(nodeList, thisNode)
	return newList, currentOffset + nodeMetadataHeader
}

func TestNodeMaker(t *testing.T) {
	numberArray := []int{0, 1, 1}
	nodeList := make([]Node, 0)
	nodeList, offset := processNodes(nodeList, numberArray, 0)
	assert.Equal(t, []Node{Node{Children: []Node{}, Metadata: []int{1}}}, nodeList)
	assert.Equal(t, 3, offset)

	longList := []int{2, 3, 0, 3, 10, 11, 12, 1, 1, 0, 1, 99, 2, 1, 1, 2}
	emptyList := make([]Node, 0)
	exectedNodes := []Node{Node{Children: []Node{}, Metadata: []int{99}}}
	actualNodeList, actualOffset := processNodes(emptyList, longList, 9)
	assert.Equal(t, exectedNodes, actualNodeList)
	assert.Equal(t, 12, actualOffset)

	cAndDexpectedNodes := []Node{Node{Children: []Node{Node{Children: []Node{}, Metadata: []int{99}}}, Metadata: []int{2}}}
	actualCandDNOdes, actualCandDOffset := processNodes(emptyList, longList, 7)
	assert.Equal(t, cAndDexpectedNodes, actualCandDNOdes)
	assert.Equal(t, 13, actualCandDOffset)

	fullListExpectedNodes := []Node{Node{Children: []Node{Node{Children: []Node{}, Metadata: []int{10, 11, 12}}, Node{Children: []Node{Node{Children: []Node{}, Metadata: []int{99}}}, Metadata: []int{2}}}, Metadata: []int{1, 1, 2}}}
	fullListActual, fullListOffset := processNodes(emptyList, longList, 0)
	assert.Equal(t, fullListExpectedNodes, fullListActual)
	assert.Equal(t, 16, fullListOffset)

}

func countChildren(rootNode Node) int {
	count := 0
	for _, child := range rootNode.Children {
		count += countChildren(child)
	}
	for _, metadata := range rootNode.Metadata {
		count += metadata
	}
	return count

}
func TestDay8Part1(t *testing.T) {
	sumFinder := func(input string) int {

		numberArray := make([]int, 0)
		for _, numStr := range strings.Split(input, " ") {
			number, err := strconv.Atoi(numStr)
			if err != nil {
				panic(fmt.Sprintf("Failed processing numbr %s. Err %v\n", numStr, err))
			}
			numberArray = append(numberArray, number)

		}

		nodeList := make([]Node, 0)
		newNodeList, _ := processNodes(nodeList, numberArray, 0)
		count := countChildren(newNodeList[0])

		return count
	}

	assert.Equal(t, 138, sumFinder(`2 3 0 3 10 11 12 1 1 0 1 99 2 1 1 2`))
	assert.Equal(t, 45868, sumFinder(day8Input))
}

func countChildrenByMetdata(rootNode Node) int {
	count := 0
	if len(rootNode.Children) == 0 {
		for _, value := range rootNode.Metadata {
			count += value
		}
	} else {
		for _, childRef := range rootNode.Metadata {
			if len(rootNode.Children) >= childRef {
				count += countChildrenByMetdata(rootNode.Children[childRef-1])
			}
		}
	}
	return count
}

func TestDay8Part2(t *testing.T) {
	rootNodeCalc := func(input string) int {

		numberArray := make([]int, 0)
		for _, numStr := range strings.Split(input, " ") {
			number, err := strconv.Atoi(numStr)
			if err != nil {
				panic(fmt.Sprintf("Failed processing numbr %s. Err %v\n", numStr, err))
			}
			numberArray = append(numberArray, number)

		}

		nodeList := make([]Node, 0)
		newNodeList, _ := processNodes(nodeList, numberArray, 0)
		return countChildrenByMetdata(newNodeList[0])
	}

	assert.Equal(t, 66, rootNodeCalc(`2 3 0 3 10 11 12 1 1 0 1 99 2 1 1 2`))
	assert.Equal(t, 66, rootNodeCalc(day8Input))

}

